function updateShortcuts() {
    try {
        try {
            shortcuts = JSON.parse(LocalStorage.getItem(KEY_SHORTCUTS));
        } catch (err) {
            LocalStorage.setItem(KEY_SHORTCUTS, JSON.stringify(DEFAULT_SHORTCUTS));
            shortcuts = JSON.parse(LocalStorage.getItem(KEY_SHORTCUTS));
        }
        renderShortcuts(shortcuts)
    } catch (err) {
        console.log("Error while parse shortcuts: " + err);
    }
}

function onFaviconLoaded(icon_url, favicon_as_data_prepared) {
    try {
        shortcuts = JSON.parse(LocalStorage.getItem(KEY_SHORTCUTS));
    } catch (err) {
        LocalStorage.setItem(KEY_SHORTCUTS, JSON.stringify(DEFAULT_SHORTCUTS));
        shortcuts = JSON.parse(LocalStorage.getItem(KEY_SHORTCUTS));
    }
    shortcuts.forEach((element) => {
        if (element.url === icon_url) {
            element.icon = favicon_as_data_prepared;
        }
    });
    LocalStorage.setItem(KEY_SHORTCUTS, JSON.stringify(shortcuts));
    updateShortcuts();
}

function renderShortcuts(shortcuts) {
    const container = document.getElementById('id-shortcut-container')
    container.innerHTML = "";
    for (let i = 0; i < SHORTCUTS_COUNT; ++i) {
        let shortcut = shortcuts[i];
        if (shortcut === undefined) {
            shortcut = addShortcut;
        }

        const sc = constructItemHtml(shortcut);
        container.appendChild(sc)
    }
}

function update() {
    try {

        try {
            shortcuts = JSON.parse(LocalStorage.getItem(KEY_SHORTCUTS));
        } catch (err) {
            LocalStorage.setItem(KEY_SHORTCUTS, JSON.stringify(DEFAULT_SHORTCUTS));
            shortcuts = JSON.parse(LocalStorage.getItem(KEY_SHORTCUTS));
        }
        renderShortcuts(shortcuts)
    } catch (err) {
        console.log("Error while parse shortcuts: " + err);
    }
}

